/*
 * Returns the Transaction ID that was set on a purchase.
 * Exampe: "ABC-12345"
 * Available: Only set on Purchase interactions.
 */
function() {

  return {{DLV - ecommerce - v1}}.purchase.actionField.id;

}

/*
 * Returns the array of product impression objects in a
 * Product Impression ecommerce interaction.
 * This is a helper value for other variables in this recipe,
 * and not intended for direct use by tags.
 */
function() {

  return {{DLV - ecommerce - v1}}.impressions;

}

/*
 * Returns the actionField and products keys of an ecommerce
 * step formatted to the Google GTM Spec.
 * This is a helper value for other variables in this recipe,
 * and not intended for direct use by tags.
 */
function() {

  var ecom = {{DLV - ecommerce - v1}};

  return ecom.click || ecom.detail || ecom.add || 
    ecom.remove || ecom.checkout || ecom.purchase ||
    ecom.refund;

}

/*
 * Returns the array of product objects in the most
 * recent ecommerce touchpoint.
 * This is a helper value for other variables in this recipe,
 * and not intended for direct use by tags.
 */
function() {

  var touchpoint = {{JS - Ecommerce Step Data}};

  if (touchpoint) { return touchpoint.products; }

}

/* 
 * Returns a string which is a delimited list of the SKUs 
 * of products present in the current ecommerce interaction.
 * The default delimiter is a comma character.
 * Example output: "ABC-123,DEG-456,EFG-789"
 */
function(){

  var prods = {{JS - Touchpoint Products}} || {{JS - Impressions}};
  var skus = [];
  var i;
  var sep = ','; // Update this value to change the delimiter

  if (!prods) { return; }

  for (i = 0; i < prods.length; i++) {
    if (prods[i].id) { skus.push(prods[i].id); } 
  }

  return skus.join(sep);

}

/* 
 * Returns a string representing the currency used to
 * denominate prices in the current ecommerce touchpoint.
 * Example: "USD"
 * Available: All interactions with products.
 */
function() {

  return {{DLV - ecommerce - v1}}.currencyCode;

}

/*
 * Returns a string indicating if the current touchpoint
 * represents a purchase action.
 * Example value: "Purchase"
 * Available: All ecommerce touchpoints.
 */
function() {

  var ecom = {{DLV - ecommerce - v1}};

  return ecom.purchase ? "Purchase" : "Non-purchase";

}

/*
 * Returns the value of tax that was paid with a purchase.
 * Example value: 12.25
 * Available: Only set on Purchase interactions.
 */
function() {

  return {{DLV - ecommerce - v1}}.purchase.actionField.tax;

}

function(){
  /* 
   * Returns a float representing the total value of all products
   * present in the current ecommerce touchpoint.
   * Calculated by summing up the product of price and quantity for
   * each product, or by summing the prices when quantity is missing.
   * This value does NOT reflect tax, shipping, discounts, or coupons.
   * Example value: 124.35
   * Available: All interactions with products.
   */

  var prods = {{JS - Touchpoint Products}} || {{JS - Impressions}};

  if (!prods) { return; } 

  var acc = 0;
  var amt, 
      qty,
      i;

  for (i = 0; i < prods.length; i++) {

    qty = Number(prods[i].quantity) || 1;
    amt = Number(prods[i].price) || 0;
    acc += qty * amt;

  }

  return acc;

}

/*
 * Returns the total value of the purchase. 
 * Uses the explicit Revenue field if present, otherwise
 * calculates based on the price and quantity of items purchased.
 * Example value: 124.35
 * Available: Only set on Purchase interactions.
 */
function() {

  var val = {{JS - Total Product Value}};

  try {

    val = {{DLV - ecommerce - v1}}.purchase.actionField.revenue;

  } catch (squelch) {}

  return val;

}

/*
 * Returns the value of shipping that was paid with a purchase.
 * Example value: 12.25
 * Available: Only set on Purchase interactions.
 */
function() {

  return {{DLV - ecommerce - v1}}.purchase.actionField.shipping;

}

/*
 * Returns the name of the touchpoint for which Enhanced Ecommerce
 * data was most recently pushed to the Data Layer
 * Example: "Product Impression
 * Availability: All interactions.
 */
function() {

  var ecom = {{DLV - ecommerce - v1}};

  return ecom.impressions ? "Product Impression" :
         ecom.click ? "Product Click" :
         ecom.detail ? "Product Detail Impression" : 
         ecom.add ? "Add to Cart" :
         ecom.remove ? "Remove from Cart" :
         ecom.checkout ? "Checkout" :
         ecom.purchase ? "Purchase" :
         ecom.refund ? "Refund" : 
         /* else */ "";

}

